INSERT INTO `notification_message` VALUES (36,1,'Active','2008-10-16 19:08:19','2013-06-27 15:22:07',2,'UserCreationEvent',NULL,35,'User Account Creation','<p>Your account with a random password created:<br />Your username is:  [Username: {User.UserName}<br />]<br />Your temporary password will be sent in a separate email</p>',1,NULL),(37,1,'Active','2008-10-16 19:08:19','2013-06-27 15:22:07',2,'CourseRegistrationEvent',NULL,36,'Course Registration','<p>Your course registration status has changed to:</p>\n<p></p>\n<p>[Status: {CourseRegistrationStatus.RegistrationStatus}<br />]\n[Learner Name : {User.FirstName}] [{User.LastName}] ( [{User.UserName}] )<br />\n[Course Name: {Course.Name}<br />]\n[Course Type: {Course.DeliveryTypeValue}<br />]</p>\n',1,NULL),(38,1,'Active','2008-10-16 19:08:19','2013-06-27 15:22:07',2,'ClassEnrolledEvent',NULL,37,'Class Registration','<p>Your class registration status has changed to:</p><p>&nbsp;</p><p>[Registration Status: {RegistrationEntry.EntryStatus}<br />] [Learner Name: {User.FirstName}] [{User.LastName}] ( [{User.UserName}] )<br /> [Course Name: {Course.Name}<br />] [Class Name: {Class.Name}<br />] [Class Dates: {Class.ClassDates}<br />] [Class Times: {Class.ClassTimes}<br />] [Instructor Name: {Instructor.FirstName} {Instructor.LastName}<br />] [<br />Class Description: {Class.Description}<br />] [<br />Virtual Class Information:<br />To join the training session<br />1. Go to {WebExClass.JoinTrainingInformation}<br />2. Enter your LMS Login information, if necessary.<br />3. Click the WebEx Session title to launch your class.<br />4. Follow the instructions that appear on your screen.<br />] [Call in information: {Class.TeleconferenceInstructions}<br />] [Launch URL: {Class.TeleconferenceLaunchUrl}<br />] [ICal Help: {MessageHelp.IcalHelp}<br /><br />The attached iCalendar file can be saved and then imported into your calendaring software to create appointments for all class sessions.<br />To Add Multiple Session iCals to Outlook Calendar:<br />1. Save the iCal file to your desktop<br /> a. From the email notification double-click the iCal file.<br /> b. Save it to your desktop.<br />2. Import the file into your Outlook calendar<br /> a. Select File | Import and Export.<br /> b. Select the Import an iCalendar or vCalendar file (.vcs) option.<br /> c. Navigate to and select the .ics file.<br /> d. Click the Ok button.<br />]</p>',1,NULL),(39,1,'Active','2008-10-16 19:08:19','2013-06-27 15:22:07',2,'ClassRegistrationEvent2',NULL,37,'Class Registration','<p>Alternate message for class registration:</p>\n<p></p>\n<p>[Status: {RegistrationEntry.EntryStatus}<br />]\n[Learner Name : {User.FirstName}] [{User.LastName}] ( [{User.UserName}] )<br />\n[Course Name: {Course.Name}<br />]\n[Class Name: {Class.Name}<br />]\n[Class Dates: {Class.ClassDates}<br />]\n[Time: {Class.ClassTimes}<br />]\n[Due To: {Reason.Name}<br />]\n[Comments: {RegistrationEntry.Comment}<br /><br />]\n[Virtual Class Information:<br />To join the training session<br />1. Go to {WebExClass.JoinTrainingInformation}<br />2. Enter your LMS Login information, if necessary.<br />3. Click the WebEx Session title to launch your class.<br />4. Follow the instructions that appear on your screen.<br />]\n[Class Description {Class.Description}<br />]\n[Call in information {Class.TeleconferenceInstructions}<br />]\n[Launch URL {Class.TeleconferenceLaunchUrl}<br />]\n[ICal Help {MessageHelp.IcalHelp} <br />The attached iCalendar file can be saved and then imported into your calendaring software to create appointments for all class sessions.<br />To Add Multiple Session iCals to Outlook Calendar:<br />1. Save the iCal file to your desktop<br />   a. From the email notification double-click the iCal file.<br />   b. Save it to your desktop.<br />2. Import the file into your Outlook calendar<br />    a. Select File | Import and Export.<br />    b. Select the Import an iCalendar or vCalendar file (.vcs) option.<br />        c. Navigate to and select the .ics file.<br />  d. Click the Ok button.<br /><br />]</p>\n',2,NULL),(40,1,'Active','2008-10-16 19:08:19','2013-06-27 15:22:07',2,'WaitListingEvent',NULL,38,'Class Registration Waitlist','<p>Your class registration status has changed to Waitlist:</p>\n<p></p>\n<p>[Learner Name : {User.FirstName}] [{User.LastName}] ( [{User.UserName}] )<br />\n[Course Name: {Course.Name}<br />]\n[Class Name: {Class.Name}<br />]\n[Class Dates: {Class.ClassDates}<br />]\n[Instructor Name: {Instructor.FirstName} {Instructor.LastName}<br />]\n[Due to: {Reason.Description}]</p>\n',1,NULL),(41,1,'Active','2008-10-16 19:08:20','2013-06-27 15:22:07',2,'ClassCancellationEvent',NULL,39,'Class Cancellation','<p>The following class has been cancelled:</p>\n<p></p>\n<p>[Class Name: {Class.Name}<br />]\n[Class Description: {Class.Description}<br />]\n[Class Dates: {Class.ClassDates}<br />]\n[Time: {Class.ClassTimes}<br />]\n[Course Name: {Course.Name}<br />]\n[Instructor Name: {Instructor.FirstName} {Instructor.LastName}<br />]\n[Due to: {Reason.Description}<br />]</p>\n',1,NULL),(42,1,'Active','2008-10-16 19:08:20','2013-06-27 15:22:07',2,'SessionCancellationEvent',NULL,40,'Session Cancellation','<p>The following session has been cancelled:</p>\n<p></p>\n<p>[Course Name: {Course.Name}<br />]\n[Class Name: {Class.Name}<br />]\n[Instructor Name: {Instructor.FirstName} {Instructor.LastName}<br />]\n[Session Date/Time: {Session.StartDate} {Session.StartTime}<br />]\n[Location Name: {Session.ClassroomLocation}]</p>\n',1,NULL),(43,1,'Active','2008-10-16 19:08:20','2013-06-27 15:22:07',2,'SessionAddedEvent',NULL,41,'Session Added','<p>The following session has been added:</p>\n<p></p>\n<p>[Course Name: {Course.Name}<br />]\n[Class Name: {Class.Name}<br />]\n[Instructor Name: {Instructor.FirstName} {Instructor.LastName}<br />]\n[Session Date/Time: {Session.StartDate} {Session.StartTime}<br />]\n[Location Name: {Session.ClassroomLocation}]</p>\n',1,NULL),(44,1,'Active','2008-10-16 19:08:20','